import styled from "styled-components";

function ProfileHeader() {
  return (
    <StyledProfileHeader>
      <ProfileImgContainer>
        <div></div>
      </ProfileImgContainer>
      <div>
        <h1>RyanWalker</h1>
        <div>404 Followers | 400 Following</div>
        <div>
          <span>About: </span>Hi I collect things.
        </div>
        <div>
          <span>Biggest Collections: </span>Vinyl - Beer - Pokemon Cards
        </div>
        <div>
          <span>About: </span>Hi I collect things.
        </div>
      </div>
    </StyledProfileHeader>
  );
}

const StyledProfileHeader = styled.div`
  display: flex;
`;

const ProfileImgContainer = styled.div`
  height: 200px;
  width: 200px;
  background: #c4c4c4;
  border-radius: 50%;
  margin-right: 6rem;
`;

export default ProfileHeader;
